import { useState } from 'react';
import Banner from './components/Banner';
import Form from './components/Form';
import Team from './components/Team';

function App() {

  const teams = [
    {
      name: 'Programação',
      firstColor: '#57C278',
      secondColor: '#D9F7E9'
    },
    {
      name: 'Front-End',
      firstColor: '#82CFFA',
      secondColor: '#E8F8FF'
    },
    {
      name: 'Data Science',
      firstColor: '',
      secondColor: ''
    },
    {
      name: 'DevOps',
      firstColor: '',
      secondColor: ''
    },
    {
      name: 'UX e Design',
      firstColor: '',
      secondColor: ''
    },
    {
      name: 'Mobile',
      firstColor: '',
      secondColor: ''
    },
    {
      name: 'Inovação e Gestão',
      firstColor: '',
      secondColor: ''
    }
  ]

  const [collaborators, setCollaborators] = useState([])

  const onNewCollaboratorAdded = (collaborator) => {
    console.log(collaborator)
    setCollaborators([...collaborators, collaborator])
  }
  return (
    <div className="App">
      <Banner />
      <Form onCollaboratorCreated={collaborator => onNewCollaboratorAdded(collaborator)} />
      <Team nome="Programação" />
      <Team nome="Front-End" />
    </div>
  );
}

export default App;
